INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, "リン", 0.0, 24001, 10040, "2030/12/17 14:59:59", 0.0, 1, 0.0, 0, "あたしだって\nやるときはやるよ！", 102601, 1, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, "リン", 0.0, 24002, 10040, "2030/12/17 14:59:59", 0.0, 1, 0.0, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 102601, 1, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, "リン", 0.0, 24003, 10040, "2030/12/17 14:59:59", 0.0, 1, 0.0, 2, "終わった終わった\n一人でもなんとか\nなるもんだね", 102601, 1, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, "リン", 0.0, 24004, 10040, "2030/12/17 14:59:59", 0.0, 2, 0.0, 3, "やったね！\nこれでようやく\nサボれるよ…", 102601, 2, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, "リン", 0.0, 24005, 10040, "2030/12/17 14:59:59", 0.0, 1, 0.0, 4, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 102601, 1, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, "リン", 0.0, 24006, 10040, "2030/12/17 14:59:59", 0.0, 2, 0.0, 5, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 102601, 2, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, "リン", 0.0, 24007, 10040, "2030/12/17 14:59:59", 0.0, 2, 0.0, 6, "あたしも意外と\nやるもんでしょ？", 102601, 2, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, "リン", 0.0, 24008, 10040, "2030/12/17 14:59:59", 0.0, 4, 0.0, 7, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 102601, 4, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, "リン", 0.0, 24009, 10040, "2030/12/17 14:59:59", 0.0, 4, 0.0, 8, "このままじゃ\nまっひ～に\n叱られちゃうよ", 102601, 4, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, "リン", 0.0, 24010, 10040, "2030/12/17 14:59:59", 0.0, 4, 0.0, 9, "まじめに\nやったんだけどな…\n悔しいな～", 102601, 4, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, "リン", 0.0, 24011, 10040, "2030/12/17 14:59:59", 0.0, 4, 0.0, 10, "やられた…\nねずみって意外と\nてごわいね", 102601, 4, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, "リン", 0.0, 24012, 10040, "2030/12/17 14:59:59", 0.0, 4, 0.0, 11, "おのれ～\nあたしのチーズを\n盗みやがって～！", 102601, 4, "2020/04/30 12:00:00");
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, "リン", 1.81, 24013, 10040, "2030/12/17 14:59:59", 0.0, 4, 0.0, 12, "疲れた…\nけど、次こそは\n守り抜くよ…", 102601, 1, "2020/04/30 12:00:00");
